    console.log('Hello');
  }
  const validateValues = ({values}) => {
    console.log(values);
  }

  return (
    <Form name="nest" onFinish={onFinish}>
      <Form.Item name={['user', 'firstName']} label="First name" rules={[{ required: true, type: 'string', validateValues }]}>
        <Input />
      </Form.Item>
      <Form.Item name={['user', 'lastName']} label="Last name" rules={[{ required: true, type: 'string', validateValues }]}>
        <Input />
      </Form.Item>
      <Form.Item>
        <Button type="primary" htmlType="submit">
          Submit
        </Button>
      </Form.Item>
    </Form>
  );
}
export default Forma;
